export default function Die(props){
    const styles = {
        backgroundColor : props.isHeld ? "lightgreen" : "none"
    }
    return (
        <div className="dice-face" style = {styles} onClick={props.holdDice}>
            <h2>{props.value}</h2>
        </div>
    )
}
